function happycat() {
    img = ""
    var canvas = document.getElementById("canvas");
    var context = canvas.getContext("2d");
    var image = new Image();
    image.onload = () => {context.drawImage(image, 0, 0, canvas.width, canvas.height); window.img = canvas.toDataURL().split(',')[1]}
    image.src = "data:image/png;base64," + img;
    confirmButton.className = "show"
    
}